import logo from './logo.svg';
import './App.css';
import Navigation from './Navigation'
import {Router,Route,Routes,Link} from 'react-router-dom';
import Home from './Home'

function App() {
  return (
    <>

      <Navigation/>

      <Routes>
      <Route path="/" element={<Home/>}></Route>
      </Routes>

    </>
  );
}

export default App;
